import React from "react";
import img from "../art-work-1.jpg"
import { FaEye, FaConnectdevelop } from "react-icons/fa";

function HomePage() {
  return (
    <div class="container">
      <div class="row">
        <div class="col-md-8">
          <div class='block'>
            <img src={img} alt="img art work" class='imgArt'/>
            <FaEye /> view in a room
            <FaConnectdevelop/> AR view
          </div>
        </div>
        <div class="col-md-4">
          <h1>Content</h1>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
